import { Project } from "../models/project";
import { Global } from "./global";

@Injectable()
export class ProjectService{
    public url:string;
    constructor(
        private _http: HttpClient
    )
    {
        this.url = Global.url;
    }

    testService(){
        return 'Probando el servicio de angular';
    }
    saveProject(project: Project):Observable<any>{
